#include <bits/stdc++.h>
using namespace std;

#define int int64_t

struct lazy_segtree {
    int sz;
    vector<int> tree, lazy;

    lazy_segtree(int n) : sz(n), tree(4 * sz), lazy(4 * sz) {}

    void push(int x, int tl, int tr) {
        if (lazy[x]) {
            tree[x] += (tr - tl) * lazy[x];
            if (tl + 1 != tr) {
                lazy[2 * x + 1] += lazy[x];
                lazy[2 * x + 2] += lazy[x];
            }
            lazy[x] = 0;
        }
    }

    int query(int l, int r, int x, int tl, int tr) {
        push(x, tl, tr);
        if (tl >= r || tr <= l) {
            return 0;
        }
        if (tl >= l && tr <= r) {
            return tree[x];
        }
        int mid = (tl + tr) / 2;
        return max(query(l, r, 2 * x + 1, tl, mid), query(l, r, 2 * x + 2, mid, tr));
    }

    int query(int l, int r) {
        return query(l, r, 0, 0, sz);
    }

    void update(int l, int r, int v, int x, int tl, int tr) {
        push(x, tl, tr);
        if (tl >= r || tr <= l) {
            return;
        }
        if (tl >= l && tr <= r) {
            tree[x] += (tr - tl) * v;
            if (tl + 1 != tr) {
                lazy[2 * x + 1] += v;
                lazy[2 * x + 2] += v;
            }
            return;
        }
        int mid = (tl + tr) / 2;
        update(l, r, v, 2 * x + 1, tl, mid);
        update(l, r, v, 2 * x + 2, mid, tr);
        tree[x] = max(tree[2 * x + 1], tree[2 * x + 2]);
    }

    void update(int l, int r, int v) {
        update(l, r, v, 0, 0, sz);
    }
};

int32_t main() {
    ios::sync_with_stdio(false);
    cin.tie(nullptr);

    int tc;
    cin >> tc;
    while (tc--) {
        int n;
        cin >> n;
        vector<vector<int>> g(n);
        for (int i = 1; i < n; i++) {
            int p;
            cin >> p;
            p--;
            g[p].push_back(i);
        }
        vector<int> a(n);
        for (int i = 0; i < n; i++) {
            cin >> a[i];
            a[i]--;
        }

        vector<vector<int>> del(n);
        vector<stack<int>> stk(n);
        auto dfs1 = [&](int u, auto &&dfs1) -> void {
            if (!stk[a[u]].empty()) {
                del[stk[a[u]].top()].push_back(u);
            }
            stk[a[u]].push(u);
            for (int v : g[u]) {
                dfs1(v, dfs1);
            }
            stk[a[u]].pop();
        };
        dfs1(0, dfs1);
        
        vector<int> tin(n), tout(n);
        int timer = 0;
        lazy_segtree st(n);
        int ans = 0;
        auto dfs2 = [&](int u, auto &&dfs2) -> void {
            tin[u] = timer++;
            for (int v : g[u]) {
                dfs2(v, dfs2);
            }
            tout[u] = timer;

            st.update(tin[u], tout[u], 1);
            for (int v : del[u]) {
                st.update(tin[v], tout[v], -1);
            }

            int mx1 = 1, mx2 = 1;
            for (int v : g[u]) {
                mx2 = max(mx2, st.query(tin[v], tout[v]));
                if (mx2 > mx1) {
                    swap(mx1, mx2);
                }
            }
            ans = max(ans, mx1 * mx2);
        };
        dfs2(0, dfs2);

        cout << ans << '\n';
    }
}

local completion = require("cc.completion")
 
local autoCompletion = {}
 
function autoComplete(text, commands)
    for pos, cmd in pairs(commands) do
        table.insert(autoCompletion, cmd.name)
    end
    return completion.choice(text, autoCompletion)
end
 
return { autoComplete = autoComplete }

